import "./Navbar.scss";
import React from "react";

export default function Navbar() {
  return (
    <nav class="navbar">
      <ul class="navbar__list">
        <li class="navbar__item">
          <div class="navbar__icon--home"></div>
          Home
        </li>
        <li class="navbar__item">
          <div class="navbar__icon--project"></div>Projects
        </li>
        <li class="navbar__item">
          <div class="navbar__icon--photos"></div>Photography
        </li>
        <li class="navbar__item">
          <div class="navbar__icon--connect"></div>Connect
        </li>
      </ul>
    </nav>
  );
}
